import React from "react";
import '../../css/units.css';
import { Row, Col, Container } from 'reactstrap';
import '../../css/custom.css';
import {useDispatch} from 'react-redux';
import GuideBook from "./guideBook";
import { setDisplayComponents } from '../../store/actions';

const Units = () => {

    const dispatch = useDispatch();
    const guideBook = GuideBook
   
    return (
        <>
            <div className="units" xs="2">
                <div className="unit-header">
                    <h3>Unit 1</h3>
                    <button onClick={() => dispatch(setDisplayComponents(guideBook))}>Guide Book</button>
                </div>
                <div className="unit-body">
                    <button id="unit-body-btn" onClick={() => PageNavigation("/lesson1")}>--</button>
                </div>
            </div>
        </>
    )
}
export default Units;
